{
 while (robotManager.Products.Products.IsStarted)
 {
  if (Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause)
  {
   if (!Questing.Has(40003) && !Questing.Has(40004) && !Questing.Has(40005) && (ObjectManager.Me.Level >= 110 || Questing.Complete(39998)))
   {
    Logging.WriteDebug("[Gates of Valor Helper] stopped");
    break;
   }

   var me = ObjectManager.Me;
   var targ = ObjectManager.Target;
   if (me.IsValid && me.IsAlive && targ.IsValid && targ.IsAlive && targ.IsTargetingMe)
   {
    Questing.UseExtraButton(1);
   }
  }
  Thread.Sleep(1000);
 }
});
t.Start();

