#if VISUAL_STUDIO
using robotManager.Helpful;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading;
using System.Threading.Tasks;
using wManager.Wow.Bot.Tasks;
using wManager.Wow.Class;
using wManager.Wow.Helpers;
using wManager.Wow.ObjectManager;
using wManager.Wow.Enums;
#endif

public class StormheimsSalvation : QuestClass
{
	static bool isCombatFixed = false;
	static uint demonicBindingsID = 214298;
	public StormheimsSalvation()
	{
		Name = "Stormheim's Salvation";
		QuestId.Add(40005);
		Step.AddRange(new[] { 1, 1 });
	}
	static void Log(string text)
	{
		Logging.WriteDebug("[Stormheim's Salvation] " + text);
	}
	static void CombatFixStart()
	{
		if (isCombatFixed)
			return;

		CombatFixEnd();
		isCombatFixed = true;
		wManager.Events.FightEvents.OnFightLoop += OnFightLoop;
		robotManager.Events.ProductEvents.OnProductStopping += OnProductStopping;
		Log("combat fix start");
	}
	static void CombatFixEnd()
	{
		wManager.Events.FightEvents.OnFightLoop -= OnFightLoop;
		robotManager.Events.ProductEvents.OnProductStopping -= OnProductStopping;
		isCombatFixed = false;
		Log("combat fix stop");
	}
	static void OnProductStopping(string productName)
	{
		CombatFixEnd();
	}
	static void OnFightLoop(WoWUnit unit, System.ComponentModel.CancelEventArgs cancelable)
	{
		if (!Questing.Has(40005))
		{
			CombatFixEnd();
			return;
		}
		var me = ObjectManager.Me;
		if (me == null || !me.IsValid || !me.IsAlive)
			return;

		if (me.PlayerUsingVehicle || me.IsOnTaxi || me.HaveBuff(demonicBindingsID))
		{
			Log("disabled. stop move and combat");
			MovementManager.StopMove();
			cancelable.Cancel = true;
			return;
		}
		/*
		var orb = Questing.FindUnit(96091);
		if (orb != null && orb.IsValid && orb.GetDistance < 10)
		{
			if (Others.Random(0, 1) == 0)
			{
				Log("orb near, strafe left");
				Move.StrafeLeft(Move.MoveAction.PressKey, Others.Random(1000, 1500));
			}
			else
			{
				Log("orb near, strafe right");
				Move.StrafeRight(Move.MoveAction.PressKey, Others.Random(1000, 1500));
			}
		}
		//*/
		var targ = ObjectManager.Target;
		var mob = Questing.FindUnit(96489, 92224, 96491, 96090);//, 92307);
		if (mob != null && mob.IsValid && mob.IsAlive && mob.IsAttackable && !mob.IsMyTarget)
		{
			if (targ != null && targ.IsValid)
			{
				wManager.wManagerSetting.AddBlackList(targ.Guid, 10 * 1000, true);
			}
			Log("change target to " + mob.Name);
			Interact.InteractGameObject(mob.GetBaseAddress);
			Fight.StartFight(mob.Guid);
			cancelable.Cancel = true;
		}
	}
	public override bool Pulse()
	{
		if (ObjectManager.Me.IsOnTaxi || ObjectManager.Me.PlayerUsingVehicle || ObjectManager.Me.HaveBuff(demonicBindingsID))
			return true;

		if (!Questing.ObjectiveComplete(this, 1))
		{
			CombatFixStart();
			if (StormheimQuests.Subzone.GatesOfValorPeak.Inside)
			{
				Log("camp mob");
				if (!Questing.Attack(92307))
					GoToTask.ToPosition(StormheimQuests.Subzone.GatesOfValorPeak.Center);

				return true;
			}
			Log("to Gates of Valor peak");
			var npc = StormheimQuests.Subzone.GatesOfValorPeak.VethirIn;
			GoToTask.ToPositionAndIntecractWithNpc(npc.Position, npc.Entry, 1);
			return true;
		}
		else if (StormheimQuests.Subzone.GatesOfValorPeak.Inside)
		{
			Log("from Gates of Valor peak");
			var npc = StormheimQuests.Subzone.GatesOfValorPeak.VethirOut;
			GoToTask.ToPositionAndIntecractWithNpc(npc.Position, npc.Entry, 1);
			return true;
		}
		Log("done");
		return true;
	}
	public override bool IsComplete()
	{
		return Questing.ObjectiveComplete(this, 1) && !StormheimQuests.Subzone.GatesOfValorPeak.Inside && !ObjectManager.Me.PlayerUsingVehicle;
	}
}
